import React from "react";
import './advert.css';

const Advert = ({data}) => {
    const __URL__ = data.url;
    const __NAME__ = data.name;
    const __CITY__ = data.city;
    const __PRICE__ = data.price;
    return (
        <div className="advert">
            <img src={__URL__} alt="photo" className="photo"/>
            <div className="name">{__NAME__}</div>
            <div className="price">{__PRICE__}</div>
            <div className="city">
                <i className="fa-thin fa-shield-check"></i>
                {/*{__CITY__}*/}
            </div>
        </div>
    );
}

export default Advert;
